import React from 'react';
import './logIn.scss'

const LogIn = () => {
    return (
        <div>
            <div className="logInBox row center">
                <div className="insta_image row center"></div>
                <div class="input-field col s10 offset-l1">
                    <input placeholder="Phone number,username, or email" id="email" type="text" class="validate" />
                </div>
            </div>
        </div>
    )
}

export default LogIn
